import React from 'react';
import './Logo.css';
import { TweenMax, Expo } from 'gsap';

// Return logo view 
export default function REturnlogo() {

 React.useEffect(() => {

  TweenMax.to('.wrp-logo-sign img', 1.2, { delay: 1, opacity: 0, y: 50, ease: Expo.easeIn })

 }, []);

 return (
  <div className='wrp-logo-sign'>
   <img src={'/img/logo.jpg'} alt={'logo view '} />
  </div>
 );
};
